import React from 'react';
import classes from "./Checkbox.module.css"

const Checkbox = () => {
    return (
        <div className={classes.container}>
            <input type="checkbox" name="checkbox"/>
            <label htmlFor="checkbox">Запомнить меня</label>
        </div>
    );
};

export default Checkbox;
